tables.table_schema:
CREATE TABLE protein_interaction_network (
    interaction_id INT PRIMARY KEY,
    protein_id_1 INT,
    protein_id_2 INT,
    interaction_type VARCHAR(50)
);

CREATE TABLE Proteins (
   protein_id INT PRIMARY KEY,
   protein_name VARCHAR(100),
   protein_function VARCHAR(200)
);

CREATE TABLE protein_networks (
    network_id INT PRIMARY KEY,
    network_name VARCHAR(50) NOT NULL,
    species VARCHAR(50) NOT NULL
);

CREATE TABLE proteins (
    protein_id INT PRIMARY KEY,
    protein_name VARCHAR(100) NOT NULL,
    gene_name VARCHAR(50) NOT NULL,
    molecular_weight DECIMAL(10,2) NOT NULL
);

CREATE TABLE interactions (
    interaction_id INT PRIMARY KEY,
    protein_1_id INT NOT NULL,
    protein_2_id INT NOT NULL,
    interaction_type VARCHAR(50) NOT NULL
);

CREATE TABLE pathways (
    pathway_id INT PRIMARY KEY,
    pathway_name VARCHAR(100) NOT NULL,
    pathway_description TEXT
);

CREATE TABLE experimental_data (
    experiment_id INT PRIMARY KEY,
    interaction_id INT NOT NULL,
    experimental_method VARCHAR(50) NOT NULL,
    experimental_result VARCHAR(100) NOT NULL
);
